// 1) create view -- here
// 2) list view -- here 
// 3) delete view 
// 4) retreive view
// 5) update view

<template>
    <v-sheet
        class="mx-auto"
        max-width="100%"
    >
        <v-slide-group
        v-model="model"
        class="pa-4"
        >
            <v-slide-item>
                <NewProject/>
            </v-slide-item>
            <v-slide-item
                v-for="song in this.songs"
                :key="song"
            >
                <ProJect
                    img_src = "https://cdn.vuetifyjs.com/images/cards/docks.jpg"
                    title = "Title"
                    subtitle = "subtitle"
                    desc = "desc"
                />
            </v-slide-item>
        </v-slide-group>


    </v-sheet>



<!-- <div>
    <NewProject/>
    <ProJect
    img_src = "https://cdn.vuetifyjs.com/images/cards/docks.jpg"
    title = "Title"
    subtitle = "subtitle"
    desc = "desc"
    />
</div> -->
</template>


<script>
import axios from 'axios'
import setToken from '@/utils/auth.js'

import ProJect from "@/components/Project/Project.vue"
import NewProject from "@/components/Project/NewProject.vue"


let url = "http://127.0.0.1:8000/api/project/"; 


export default {
    name: 'ProjectView',

    data: () => ({
        model: null,
        songs : []
        
    }),

    components:{
        ProJect,
        NewProject
    },

    mounted(){
        console.log(localStorage.getItem("user"))
        axios({
            method: "GET",
            url: url, // localhost:8000/user/1 ë¡œ delete method
            headers: setToken(),
            params: {
                user_id : localStorage.getItem('user'),
            },
        })
            .then((response) => {
                console.log(response.data);
                this.songs = response.data
                console.log("done")

                // js redirect
                // window.location.href = 'http://localhost:8080/';
                // vue
                //this.$router.push({ name : 'home'})

            })
            .catch((error) => {
                console.log("Failed to get song list", error.response);
            });
    }


}
</script>

<style scoped>
    .blurred{
        background: rgba(0, 0, 0, 0.2);
        backdrop-filter: blur(2px);
    }
</style>
